    false,nt"url": null,nt"notes": "This document describes the plan for managing
    waters on Tewaukon National Wildlfie Refuge for calendar year 1965.  Water use data
    for the year 1964 is included in the plan for the following sites: Lake Tewaukon,
    Cutler Marsh, White Lake, Clouds Lake, Sprague lake, Mann Lake and Refuge Pools
    5-7 and 9.  The proposed plan begins with a summary of the 1964 water program, which
    reviews general information, food supplies, waterfowl use and vegetation control.
     The water management section explains proposed management actions for the year
    1965 at each water gage site.  This document also includes a letter of confirmation
    for approval of the plan and a memorandum with comments from the regional engineer.
     A map is attached indicating the location of water gages.",nt"license_title":
